import React, {Fragment, useState} from "react";

function Todos(){
    const [todosState, setTodosState] = useState(['việc 1', 'việc 2', 'việc 3'])

    const allTodos = []

    for(let todo of todosState){
        allTodos.push(<p>{todo}</p>) 
    }
    return(
        <Fragment>{allTodos}</Fragment>
    )
}

export default Todos
